script: |
  super -f text -I q2969.spq | sort > q2969.out

inputs:
  - name: q2969.spq
    data: |
      SELECT + col1 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT + 78 + + col2 + + 69 IN ( CAST ( - col2 AS INTEGER ) / + 8 * 23 + col1, - col1, + col2 * + + col2 );
  - name: tab2

outputs:
  - name: q2969.out
    data: |
      51
      67
      77
